B.JO=new A.bl("as i was pulling back my car, the maintenance staff member pulled up with his car exiting the parking lot (there is one barricade for going in and another for going out of the parking lot). he was probably going home after his work day. he pulled down his window and said, \u201chey man is it not working again?\u201d",null,null,B.r,null)
