B.Jw=new A.bl("overall, it was an amazing experience. my main role was an engineer/pm hybrid, assisting the two main engineers in frontend development, creating custom functions in the backend (simple data structure massaging to save time for the main engineers), and bridging my girlfriend's designs with development.",null,null,B.r,null)
B.Jx=new A.bl("after 36 hours of hacking, i felt that i got a lot more comfortable with TypeScript as i learned a lot from the main engineers, and i've never coded under a time pressure like that so that was a good learning experiene",null,null,B.r,null)
B.Jz=new A.bl("after a year of on-and-off cycles of building (and resting), with Bean, the team was able to get to be part of Duke Innovation Studio's Spring '23 Cohort and eventually mvp-launched to the Duke community in april-2023, gain a couple hundred users, got meaningful insights, further ideas to work on.",null,null,B.r,null)
B.JA=new A.bl(" is an independent label i co-run with one of my best friends. we're hoping to grow it into a family of independent artists (musicians, poets, painters, etc.) that come together to insprie each other and take turns fundraising from fans for a cause, using artistry as a means.",null,null,B.r,null)
B.L6=new A.u(!0,null,null,null,null,null,null,null,B.nf,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null,null)
