B.JG=new A.bl('the name of the label, long story short, comes down to how amazing (to the n-th degree) of a human being Clouds in Seoul (the guy im co-running the label) is. as someone who has been exposed to his stories and music for as long as i can remember, i truly began to realize the power of "good people attracting to good people", art and music aside.',null,null,B.r,null)
B.JI=new A.bl("as of now, the service is not active, but i hope to grow this at some point into something useful, if not a fully-launched product.",null,null,B.r,null)
B.JJ=new A.bl(" is an AI-supported tool (marrying GPT3.5 and DeepL) that helps non-native English speakers learn to code, from learning simple syntax to debugging.",null,null,B.r,null)
B.JK=new A.bl("\n",null,null,B.r,null)
B.JM=new A.bl("i had come back to campus for my senior year a week-ish late, and my girlfriend wanted me to do a hackathon with her. she said she's worked with these twin engineers (then-sophomores at duke) who are great and us four together would make a great team. i was so so exhausted from catching up with school work and just wanted to \"chill\", but i gave it a go since it's only a weekend-long hackathon.",null,null,B.r,null)
B.JN=new A.bl("songwriting is super fun for me, and i hope to continue working on this for quite a while!",null,null,B.r,null)
B.JP=new A.bl('i was bored sophomore year and wanted to make a "tinder for guessing market events" for one reason or another (if i recall, one of the reasons was that i simply did not have the skills), the team ended up building a webapp that helps people optimize their co-living experience on campus, off campus, during summer internship, etc. the idea came about when i was stuck (again due to lack of my capabilities) and the designer on the team (my girlfriend) floated the idea of a roommate-matching platform. i liked the idea mostly because i could tell building it would teach me so many things i had been wanting to learn abt, but i also did zoom out and realized how much a struggle-topic co-living is to college students.',null,null,B.r,null)
